import React from 'react'
import styled from 'styled-components'
import { NavLink } from 'react-router-dom'

import house from '../Images/house.png'

const Projects: React.FC = () =>{

    return(
        <StyledContainer>
            <StyledSectionsHolder>
            <StyledSections to='/' exact><img width="30px" height="30px" src={house} alt='house to show that this is a button to home'/></StyledSections>
            </StyledSectionsHolder>
            <StyledHeader>My personal Projects,<br/>some for fun some for utility.</StyledHeader>
        </StyledContainer>
    )
}

const StyledHeader = styled.h3`
    text-align: center;
`
const StyledSections = styled(NavLink)`
    height: 10%;
    width: 10%;
    padding:2%;
`
const StyledSectionsHolder = styled.nav`
    position: absolute;
    color:unset;
    text-decoration: none;
    top: 3%;
    left: 3%;
    height: 15%;
    width: 15%;
    display: flex;
`

const StyledContainer = styled.div`
display: flex;
flex-flow: column;
margin-left: auto;
margin-right: auto;
border-radius: 4px;
justify-content: center;
width: 80%;
height: 90%;
background-color: #008B8B;
`
export default Projects;
